CREATE TABLE IF NOT EXISTS "Users" ("id"   SERIAL , "email" VARCHAR(255) NOT NULL UNIQUE, "password" 
VARCHAR(255) NOT NULL, "roles" VARCHAR(255) DEFAULT 'user', "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, 
"updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, "deletedAt" TIMESTAMP WITH TIME ZONE, PRIMARY KEY ("id"));

CREATE TABLE IF NOT EXISTS "Movies" ("id"  SERIAL , "poster" INTEGER NOT NULL REFERENCES "Users" ("id")
 ON DELETE CASCADE ON UPDATE CASCADE, "title" VARCHAR(255) NOT NULL, "genres" VARCHAR(255)[] NOT NULL, 
 "releaseYear" INTEGER NOT NULL, "description" TEXT NOT NULL, "directors" VARCHAR(255)[] NOT NULL,
  "producers" VARCHAR(255)[] NOT NULL, "averageRating" FLOAT DEFAULT '0', "imageThumbnail" TEXT, "image" TEXT,
   "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL, "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, "deletedAt" TIMESTAMP WITH TIME ZONE, PRIMARY KEY ("id"));

CREATE TABLE IF NOT EXISTS "Ratings" ("id"  SERIAL , "userId" INTEGER NOT NULL REFERENCES 
"Users" ("id") ON DELETE CASCADE ON UPDATE CASCADE, "movieId" INTEGER NOT NULL REFERENCES "Movies" ("id") 
ON DELETE CASCADE ON UPDATE CASCADE, "rating" FLOAT NOT NULL, "review" TEXT, "createdAt" TIMESTAMP WITH TIME ZONE NOT NULL,
 "updatedAt" TIMESTAMP WITH TIME ZONE NOT NULL, "deletedAt" TIMESTAMP WITH TIME ZONE, PRIMARY KEY ("id"));





